import React, { useState, useEffect } from 'react';
import axios from 'axios';

const UploadResource = () => {
  const [universities, setUniversities] = useState([]);
  const [formData, setFormData] = useState({
    university: '',
    department: '',
    course: '',
    semester: '',
    type: 'notes',
    title: '',
    file: null,
  });

  const fetchUniversities = async () => {
    try {
      const response = await axios.get('/api/universities');
      setUniversities(response.data);
    } catch (err) {
      console.error('Failed to load universities:', err);
    }
  };

  useEffect(() => {
    fetchUniversities();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value
    }));
  };

  const handleFileChange = (e) => {
    setFormData((prev) => ({
      ...prev,
      file: e.target.files[0]
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const data = new FormData();
      data.append('university', formData.university);
      data.append('department', formData.department);
      data.append('course', formData.course);
      data.append('semester', formData.semester);
      data.append('type', formData.type);
      data.append('title', formData.title);
      data.append('file', formData.file);

      const response = await axios.post('/api/resources/upload', data);
      alert('✅ Resource uploaded successfully!');
      console.log(response.data);
    } catch (err) {
      console.error('❌ Upload error:', err);
      alert('❌ Upload failed!');
    }
  };

  return (
    <div>
      <h2>Upload Academic Resource</h2>
      <form onSubmit={handleSubmit} encType="multipart/form-data">
        <label>
          University:
          <select name="university" value={formData.university} onChange={handleChange} required>
            <option value="">Select University</option>
            {universities.map((uni) => (
              <option key={uni._id} value={uni._id}>{uni.name}</option>
            ))}
          </select>
        </label>
        <br />

        <label>
          Department:
          <input type="text" name="department" value={formData.department} onChange={handleChange} required />
        </label>
        <br />

        <label>
          Course:
          <input type="text" name="course" value={formData.course} onChange={handleChange} required />
        </label>
        <br />

        <label>
          Semester:
          <input type="text" name="semester" value={formData.semester} onChange={handleChange} required />
        </label>
        <br />

        <label>
          Title:
          <input type="text" name="title" value={formData.title} onChange={handleChange} required />
        </label>
        <br />

        <label>
          Type:
          <select name="type" value={formData.type} onChange={handleChange} required>
            <option value="notes">Notes</option>
            <option value="syllabus">Syllabus</option>
            <option value="papers">Papers</option>
          </select>
        </label>
        <br />

        <label>
          Upload File:
          <input type="file" onChange={handleFileChange} accept=".pdf,.doc,.docx,.ppt,.pptx,.png,.jpg,.jpeg" required />
        </label>
        <br />

        <button type="submit">Upload</button>
      </form>
    </div>
  );
};

export default UploadResource;
